PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "skills" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "source_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "sources" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "heightweights" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "created_at" datetime, "updated_at" datetime, "weight" integer);
CREATE TABLE "roles" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "positions" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "positioncoefficients" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "position_id" integer, "skill_id" integer, "coefficient" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "rolevalues" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "role_id" integer, "skill_id" integer, "value" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "heightweightvalues" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "heightweight_id" integer, "skill_id" integer, "value" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "assignments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "role_id" integer, "position_id" integer, "suitability" integer, "description" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "accomplishments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "section" varchar(255), "linenumber" integer, "description" varchar(255), "skill_id" integer, "skillamount" integer, "otherreward" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "players" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar(255), "description" varchar(255), "owner" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "playeraccomplishments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "player_id" integer, "accomplishment_id" integer, "achieved" boolean, "when" datetime, "created_at" datetime, "updated_at" datetime);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE INDEX "index_skills_on_source_id" ON "skills" ("source_id");
CREATE INDEX "index_positioncoefficients_on_position_id" ON "positioncoefficients" ("position_id");
CREATE INDEX "index_positioncoefficients_on_skill_id" ON "positioncoefficients" ("skill_id");
CREATE INDEX "index_rolevalues_on_role_id" ON "rolevalues" ("role_id");
CREATE INDEX "index_rolevalues_on_skill_id" ON "rolevalues" ("skill_id");
CREATE INDEX "index_heightweightvalues_on_heightweight_id" ON "heightweightvalues" ("heightweight_id");
CREATE INDEX "index_heightweightvalues_on_skill_id" ON "heightweightvalues" ("skill_id");
CREATE INDEX "index_assignments_on_role_id" ON "assignments" ("role_id");
CREATE INDEX "index_assignments_on_position_id" ON "assignments" ("position_id");
CREATE INDEX "index_accomplishments_on_skill_id" ON "accomplishments" ("skill_id");
CREATE INDEX "index_playeraccomplishments_on_player_id" ON "playeraccomplishments" ("player_id");
CREATE INDEX "index_playeraccomplishments_on_accomplishment_id" ON "playeraccomplishments" ("accomplishment_id");
COMMIT;
